import React from "react";
import { Link } from "react-router-dom";
import { Navbar, Nav } from "react-bootstrap";

function Navigation() {
  return (
    <React.Fragment className="nav">
      <Navbar>
        <Navbar.Brand className="navbar-brand text-white" to="/" href="index.html">
          <strong>MICHAEL GRAGG</strong>
        </Navbar.Brand>
          <Nav className="navbar-nav mr-auto">
            <Nav.Link eventKey="1" as={Link} to="/" className="nav-link" href="home page">
              About
            </Nav.Link>
            <Nav.Link eventKey="2" as={Link} to="/portfolio" className="nav-link" href="portfolio page">
              Portfolio
            </Nav.Link>

            <a className="nav-link" href="Gragg-Resume.pdf" target="_blank" rel="noopener noreferrer">
              Resume
            </a>
          </Nav>
      </Navbar>
    </React.Fragment>
  );
}

export default Navigation;
